// App.js
import './style/App.css';
import React, { useState } from 'react';
import { Canvas } from '@react-three/fiber';
import { OrbitControls } from '@react-three/drei';
import { BrowserRouter as Router, Route, Routes, useNavigate } from 'react-router-dom'; // Use Routes instead of Switch
import Earth from './components/Earth';
import Home from './pages/Home';

const App = () => {
  const [clicked, setClicked] = useState(false);
  const navigate = useNavigate();

  const handleClick = () => {
    setClicked(true);
  };

  return (
    <Router>
      <div className={`app-container ${clicked ? 'clicked' : ''}`} onClick={handleClick}>
        <Canvas camera={{ position: [0, 0, 2] }}>
          <ambientLight />
          <pointLight position={[10, 10, 10]} />
          {!clicked && <Earth navigate={navigate} />}
          {/* ... */}
        </Canvas>
        {/* ... */}
      </div>
      <Routes>
        <Route path="/home" element={<Home />} />
      </Routes>
    </Router>
  );
};

export default App;
